import React, { Component } from 'react'

class Socials extends Component {
    render() { 
        return (
            <div className="socials">
                <ul>
                    <li><FontAwesomeIcon icon="fa-brands fa-slack" /></li>
                    <li><FontAwesomeIcon icon="fa-brands fa-github" /></li>
                </ul>
            </div>
        );
    }
}
 
export default Socials;
